import React, { useEffect, useState } from "react";
import Header from "./components/header";
import fetchJsonp from "fetch-jsonp";

function App() {
    const [Loading, setLoading] = useState(true);
    const [airlinesData, setAirlinesData] = useState([]);

    const [alliance, setAlliance] = useState([]);

    useEffect(() => {
        fetchJsonp(
            "https://kayak.com/h/mobileapis/directory/airlines/homework.api",
            {
                jsonpCallback: "jsonp",
            }
        )
            .then((res) => res.json())
            .then((data) => {
                setAirlinesData(data);
            });
    }, [alliance]);

    if (Loading == true) {
        return (
            <div>
                <Header />
                <h2>Loading...</h2>
            </div>
        );
    }

    return (
        console.log(airlinesData),
        (
            <div>
                <Header />
            </div>
        )
    );
}

export default App;
